pragma solidity  ^0.8.3;
contract Counter
{
    uint  count;   //unsigned int (0-256 bits)
    //uint8,unit256(256 bits in size);
    //int ,int 256--->
    function inc() public
    {
        count ++;
    }
    function dec() public
    {
        count--;
    }
    function get() public view returns(uint)
    {
        return count;
    }

}

